import service from '@/api';
export interface Pagination<T> {
  pages: number;
  total: number;
  pageNum: number;
  data: T[];
}

//获取用户信息
export const USERPROFILE_URL = '/v1/user/getUserInformation';
export interface GameData {
  id: number;
  name: string;
  icon: string;
  image: string;
  prizePool: number;
  cmd: string;
  gameUrl: string;
  groupId: number;
}
export type GameItem = Pagination<GameData>;

export interface UserStatisticsItem {
  betAmount: number;
  betNumber: number;
  winAmount: number;
}
export interface UserProfileResp {
  userStatistics: UserStatisticsItem;
  game: GameItem;
  user: {
    id: number;
    name: string;
    avatar: string;
    level: number;
    exp: number;
    email: string;
    createDays: string;
    cashBack: number;
  };
}

//获取获取用户各个币种的余额
export const USERBALANCE_URL = '/v1/user/getBalance';
export interface BabalceRespItem {
  currencyId: number;
  value: number;
}

//获取游戏记录
export const GAMEALL_URL = '/v1/user/getGameHistory';

export interface UserGameReq {
  pageSize: number;
  pageNumber: number;
}
export interface UserGameItem {
  id: number;
  currencyId: number;
  username: string;
  avatar: number;
  level: number;
  gameName: string;
  createTime: string;
  gameIcon: string;
  currencyIcon?: string;
  chip: number;
  rate: number;
  win: number;
}
export type UserGameResp = Pagination<UserGameItem>;

//用户修改密码
export const CHANGEPASSWORD_URL = '/v1/user/updatePassword';
export interface ChangePassReq {
  oldPassword: string;
  newPassword: string;
}

//根据用户ID查询个人档案
export const QUERYFILES_URL = '/v1/global/getUserInfo';

export interface UserInfoReq {
  userId: number;
}
